import React, {Component} from 'react';

class CovidUtil extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        const styleSeparator = {
            marginBottom: 10
        }

        return ( 
            <div className="p-grid p-fluid">

                <div className="p-col-12 p-lg-12">
                    <div className="card ">
                        <h1>Timeline</h1>
                        <a 
                            href="https://youtu.be/_V4r5ibOm5g " 
                            target="_blank" 
                            rel="noopener noreferrer">
                            <i className='fas fa-video' style={{marginRight: '10px'}}/> 
                            Documentário para entender como saímos de um surto de pneumonia supostamente inofensivo numa cidade do interior da China para o maior perigo à humanidade
                        </a>

                        <div className="p-col-12 p-lg-12" style={styleSeparator} />                    

                        <h1>Belo Horizonte</h1>
                        <a 
                            href="https://www.covidbh2020.com/" 
                            target="_blank" 
                            rel="noopener noreferrer">
                            <i className='fas fa-virus' style={{marginRight: '10px'}}/> 
                            Acompanhe o mapa interativo da COVID-19 com informação por bairros da capital
                        </a>

                        <div className="p-col-12 p-lg-12" style={styleSeparator} /> 
                    </div>
                </div>
            </div>
         ); 
    }
}

export default CovidUtil;
